css:
@-moz-document url-prefix('https://www.tumblr.com/') {

.logo .svg-logo {display: none}
H1.logo/*.logo-redesign*/ .logo-anchor {height: 100%}

/*#logo {*/
H1.logo/*.logo-redesign*/ {
	margin: 0 16px 0 8px;
	width: 245px;
	height: 53px;
}
/*#logo > .logo_anchor {*/
H1.logo/*.logo-redesign*/ > .logo-anchor {
	display: block;
	background-size: auto;
	background-repeat: no-repeat;
	background-image: url("/*[[logo]]*/");
}

}
